tables.table_schema:
CREATE TABLE historical_solar_power_data (
    date DATE,
    time TIME,
    power_output DECIMAL
);

CREATE TABLE weather_data (
    date DATE,
    temperature DECIMAL,
    humidity DECIMAL,
    precipitation DECIMAL
);

CREATE TABLE SolarPowerData (
    date DATE,
    power_generation DECIMAL
);

CREATE TABLE SolarLocations (
    location_id INT,
    location_name VARCHAR,
    latitude DECIMAL,
    longitude DECIMAL
);

CREATE TABLE WeatherData (
    date DATE,
    temperature DECIMAL,
    humidity DECIMAL
);

CREATE TABLE PowerConsumption (
    date DATE,
    consumption DECIMAL
);
